import React from "react";

function UsedOil() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Used Oil</h1>
      <p>Take used motor oil to approved recycling or drop-off centers.</p>
    </div>
  );
}

export default UsedOil;
